   void appendDistanceRowsToSetMO(String trainSet,COGGOMap map,COGdistancefeaturesRight cdf, int isTrain){
        
         FileWriter fw;
                try
                {
           fw = new FileWriter(trainSet,true); //the true will append the new data
//remove string and write directly to dataset
           Iterator<String> keySetIterator = cdf.distances.keySet().iterator();
           //String row="";
           int current=0;
          while(keySetIterator.hasNext()){
              String COG=keySetIterator.next();
              fw.write("\""+COG+"\", ");
              ArrayList<Triplet<Integer,Integer,ArrayList<Pair<Integer,Integer>>>> tmp=cdf.distances.get(COG);
              current=0;
              for(int i=0;i<tmp.size();i++){
                  if(cdf.plasmids.contains(i) || tmp.get(i).getValue0()==0){
                      current++;
                      continue;
                  }
                  fw.write(cdf.maxCoord.get(current)+", ");
                    current++;
                  for(int j=0;j<tmp.get(i).getValue0();j++){
                      if(j<tmp.get(i).getValue2().size())
                            if(tmp.get(i).getValue2().get(j).getValue0()==Integer.MAX_VALUE || tmp.get(i).getValue2().get(j).getValue1()==Integer.MAX_VALUE)
                                fw.write("-1, -1, ");//put ?, ?,
                            else
                                fw.write(tmp.get(i).getValue2().get(j).getValue0()+", "+tmp.get(i).getValue2().get(j).getValue1()+", ");
                      else{
                         fw.write("-1, -1, ");//put ?, ?, 
                      }
                    }
                  if(!cdf.plasmidIndex.containsKey(cdf.distances.get(COG).get(i).getValue1()))
                  fw.write("-2, ");//end of organism
                  else
                       fw.write("-3, ");//will be continued with plasmids
                  
                  if(cdf.plasmidIndex.containsKey(cdf.distances.get(COG).get(i).getValue1())){
                        ArrayList<Integer> index=cdf.plasmidIndex.get(cdf.distances.get(COG).get(i).getValue1());
                        int s=0;
                        for(int ind=0;ind<index.size();ind++){
                            
                            if(tmp.get(index.get(ind)).getValue0()==0)
                                continue;
                            
                            fw.write(cdf.maxCoord.get(index.get(ind))+", ");
                            
                            for(int j=0;j<tmp.get(index.get(ind)).getValue0();j++){
                                if(j<tmp.get(index.get(ind)).getValue2().size())
                                    if(tmp.get(index.get(ind)).getValue2().get(j).getValue0()==Integer.MAX_VALUE || tmp.get(index.get(ind)).getValue2().get(j).getValue1()==Integer.MAX_VALUE)
                                        fw.write("-1, -1, ");//put ?, ?,
                                     else
                                         fw.write(tmp.get(index.get(ind)).getValue2().get(j).getValue0()+", "+tmp.get(index.get(ind)).getValue2().get(j).getValue1()+", ");
                                else{
                                    fw.write("-1, -1, ");//put ?, ?, 
                                }
                            }    
                            if(s<index.size()-1)
                                fw.write("-3, "); //continued with plasmid
                            else 
                                fw.write("-2, ");//end of organism
                            s++;
                        }         
                    } 
                  
              }
             ArrayList<String> cgm=map.CogGOmap.get(COG);
              int count=0;
              if(map.CogGOmap.containsKey(COG))
                  count=cgm.size();

              if(count>0 && isTrain==1){
                  String target="";
                  for (int j=0;j<cgm.size();j++)
                      if(j<cgm.size()-1)
                         target+=cgm.get(j)+"@";
                      else
                          target+=cgm.get(j);
                 fw.write(target);
                 fw.write("\n");
              }
              /*else if(count==0 && isTrain==0){
                  row=row.substring(0, row.length()-2);
                  row+="\n";
                  fw.write(row);
              }
              row="";*/ //should modify if factorizations required
             }
           fw.close();
                }
          catch(IOException ioe)
{
    System.err.println("IOException: " + ioe.getMessage());
}
    }
       
    void appendDistanceRowsToSet(String trainSet,COGGOMap map,COGdistancefeatures cdf, int isTrain){
        
         FileWriter fw;
                try
                {
           fw = new FileWriter(trainSet,true); //the true will append the new data

           Iterator<String> keySetIterator = cdf.distances.keySet().iterator();
           String row="";
           int current=0;
          while(keySetIterator.hasNext()){
              String COG=keySetIterator.next();
              row+="\""+COG+"\", ";
              ArrayList<Pair<Integer,Integer>> tmp=cdf.distances.get(COG);
              current=0;
              for(int i=0;i<tmp.size();i++){
                  row+=cdf.maxCoord.get(current)+", ";
                  current++;
                  if(tmp.get(i).getValue0()==Integer.MAX_VALUE || tmp.get(i).getValue1()==Integer.MAX_VALUE)
                      row+="-1, -1, ";//put ?, ?,
                  else
                    row+=tmp.get(i).getValue0()+", "+tmp.get(i).getValue1()+", ";
              }
             ArrayList<String> cgm=map.CogGOmap.get(COG);
              int count=0;
              if(map.CogGOmap.containsKey(COG))
                  count=cgm.size();

              if(count>0 && isTrain==1){
                  String target="";
                  for (int j=0;j<cgm.size();j++)
                      if(j<cgm.size()-1)
                         target+=cgm.get(j)+"@";
                      else
                          target+=cgm.get(j);
                 row+=target;
                 row+="\n";
                 fw.write(row);
              }
              else if(count==0 && isTrain==0){
                  row=row.substring(0, row.length()-2);
                  row+="\n";
                  fw.write(row);
              }
              row="";
             }
           fw.close();
                }
          catch(IOException ioe)
{
    System.err.println("IOException: " + ioe.getMessage());
}
    }

