    void appendRowsToSet(String trainSet,COGGOMap map,COGfeatures features, int isTrain){
        
         FileWriter fw;
                try
                {
           fw = new FileWriter(trainSet,true); //the true will append the new data

           Iterator<String> keySetIterator = features.COGfeaturesmap.keySet().iterator();
           String row="";
          while(keySetIterator.hasNext()){
              String COG=keySetIterator.next();
              row+="\""+COG+"\", ";
              ArrayList<Integer> tmp=features.COGfeaturesmap.get(COG);
              for(int i=0;i<tmp.size();i++)
                  row+=tmp.get(i)+", ";

             ArrayList<String> cgm=map.CogGOmap.get(COG);
              int count=0;
              if(map.CogGOmap.containsKey(COG))
                  count=cgm.size();

              if(count>0 && isTrain==1){
                  String target="";
                  for (int j=0;j<cgm.size();j++)
                      if(j<cgm.size()-1)
                         target+=cgm.get(j)+"@";
                      else
                          target+=cgm.get(j);
                 row+=target;
                 row+="\n";
                 fw.write(row);
              }
              else if(count==0 && isTrain==0){
                  row=row.substring(0, row.length()-2);
                  row+="\n";
                  fw.write(row);
              }
              row="";
             }
           fw.close();
                }
          catch(IOException ioe)
{
    System.err.println("IOException: " + ioe.getMessage());
}
    }
    
